import React, { Component } from 'react';
import PropTypes from 'prop-types'
import ProductItem from "../../../../redux-shopping-cart/src/components/Productitem";

class Header extends Component{
  componentDidMount() {

  }
  render() {
    const imgUrl = require('../../static/images/logo.png')
    const placeText = '搜索商品，共12638款好物'
    return (
      <div className="home_header_wrapper">
        <img src={imgUrl} width={70} alt=""/>
        <div className="input_wrapper">
          <input placeholder={placeText} onClick={goPageSearch => onAddToCartClicked} type="text"/>
          <i className="iconfont icon-sousuo1"></i>
        </div>
        <div className="login_btn">登录</div>
      </div>
    )
  }
}
Header.propTypes = {
  goPageSearch: PropTypes.func.isRequired
}

export default Header
